import React, { Component } from "react";
import { Section, StyledButton } from "../Components";
import Tab from "../Components/Tabs";


import "./job.css";

class Job extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Section fifth>
        <div style={{ paddingRight: "15%", paddingLeft: "15%" }}>
          <div
            style={{
              fontWeight: "bold",
              fontSize: "35px",
              marginBottom: "2%",
            }}
          >
            Looking for a job?
          </div>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              flex: 1,
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            {fifth.map((card, index) => (
              <Tab
                fifth={true}
                number={card.id}
                img={card.img}
                message={card.message}
              />
            ))}
          </div>
        </div>
      </Section>
    );
  }
}

export default Job;
